merge into SETTL_PLAN sp using 
(select settl_plan_id,PLAN_DESC,SETTL_PLAN_TYPE from settl_plan where 
SETTL_PLAN_ID between 111 and 147  
and INSTITUTION_ID = '130') osp 
on (sp.settl_plan_id = osp.settl_plan_id 
and (SETTL_PLAN_ID between 111 and 117   or SETTL_PLAN_ID between 121 and 127 or SETTL_PLAN_ID between 131 and 137 or SETTL_PLAN_ID between 141 and 147 )
and sp.INSTITUTION_ID = '101')
when matched then update set sp.PLAN_DESC = osp.PLAN_DESC,sp.SETTL_PLAN_TYPE = osp.SETTL_PLAN_TYPE
when not matched then insert ( INSTITUTION_ID,SETTL_PLAN_ID,PLAN_DESC,SETTL_PLAN_TYPE) values ('101',osp.SETTL_PLAN_ID,osp.PLAN_DESC,osp.SETTL_PLAN_TYPE);

REM INSERTING into SETTL_PLAN
SET DEFINE OFF;
